import React from "react";

const Moi = () => {
    return (
        <div className="Moi">
            <h2 className="Moi">Lorem, ipsum dolor.</h2>
            <h4>
                Lorem ipsum dolor sit amet, consectetur adipisicing elit. Atque
                harum illo pariatur ratione, voluptatem quis quo earum dolorem
                praesentium libero quidem hic voluptate?
            </h4>
        </div>
    );
};

export default Moi;
